public static int comp (String s, String t){ 
  int d[][]; 
  int n, m, i, j;  
  char si, tj, cost;  

  n = s.length (); 
  m = t.length (); 
  if (n == 0) 
    return m; 
  if (m == 0) 
    return n; 

  d = <*1>; 
  for (i = 0; i <= n; i++) 
    d[i][0] = i; 

  for (j = 0; j <= m; j++) 
    d[0][j] = j; 

  for (i = 1; i <= n; i++) { 
    si = s.charAt (i - 1); 
    for (j = 1; j <= m; j++) { 
      tj = t.charAt (j - 1); 

      if (si == tj) 
        cost = 0; 
      else 
        cost = 1; 

      d[i][j] = eval(d[i-1][j]+1,  
d[i][j-1]+1, d[i-1][j-1] + cost);
    } 
  } 
  return d[n][m]; 
}

