public class Node{ 
  public int val; 
  public Node lc; 
  public Node rc; 
} 
------------------------------------------ 
public class Structure{ 
  private Node myCon; 

  public void add(int v){ 
    myCon = add(v, myCon); 
  } 

  private Node add(int v, Node n){ 
    if( n == null ){ 
      n = new Node(); 
      n.val = v; 
    } 
    if( v < n.val ) 
      n.lc = add(v, n.lc); 
    else if( v > n.val ) 
      n.rc = add( v, n.rc); 
    return n; 
  } 

  public void show(){ 
    show(myCon); 
  } 

  private void show(Node n){ 
    if( n != null ){ 
      System.out.print(n.val); 
      show(n.rc); 
      show(n.lc); 
    } 
  }  

  public int find(){ 
    return find(myCon); 
  } 

  private int find(Node n){ 
    if( n == null ) 
      return -1; 
    return 1  
+ Math.max( find(n.lc), find(n.rc) );
  } 
}
